   if(show){
    console.log("you are in Maxshow")
    return(
<div className="maxShow" onClick={()=>setShow({})}>
    <p className="closeTag" >X</p>
    <img src="https://kolesa-uploads.ru/-/f8cebc96-e521-4f62-85cf-31b4357decd5/preview-bmw-x5l.jpg" height={"399px"} width={"400px"}></img>
  <ul>
    <li>{show.marka} </li>
    <li> {show.model}</li>
    <li> {show.year}</li>
    <li> {show.information}</li>
  </ul>
</div>
    )
   }
}

export default Maxshow
